import React from 'react';



class Nav  extends React.Component {


    render() { 
        return ( 
<div>
        <h1>Burger Menu</h1>
        <input type="checkbox" id="burger"/>

        <label htmlFor="burger">
        <span></span>
        <span></span>
        <span></span>
        
        </label>
        <nav>
<ul>
    <li><a href="#">Link 1</a></li>
    <li><a href="#">Link 1</a></li>
    <li><a href="#">Link 1</a></li>

</ul>

        </nav>
        </div>
        );
    }
}
export default Nav ;
